import React, { useState } from "react";
import {
  StyleSheet,
  View,
  Text,
  TextInput,
  TouchableOpacity,
  ScrollView,
  Image,
} from "react-native";
import LinearGradient from "react-native-linear-gradient";
import { launchImageLibrary } from "react-native-image-picker";
import { api } from "../services/api";
import { COLORS } from "../utils/constants";

const PostAdScreen = ({ navigation }) => {
  const [form, setForm] = useState({
    title: "",
    price: "",
    category: "",
    location: "",
    year: "",
    mileage: "",
    description: "",
    image: null,
  });

  const handleImagePick = () => {
    launchImageLibrary({ mediaType: "photo" }, (response) => {
      if (response.assets) {
        setForm({ ...form, image: response.assets[0].uri });
      }
    });
  };

  const handleSubmit = async () => {
    try {
      const formData = new FormData();
      Object.keys(form).forEach((key) => {
        if (key === "image" && form.image) {
          formData.append("image", {
            uri: form.image,
            type: "image/jpeg",
            name: "vehicle.jpg",
          });
        } else {
          formData.append(key, form[key]);
        }
      });
      await api.post("/vehicles", formData, {
        headers: { "Content-Type": "multipart/form-data" },
      });
      navigation.navigate("Home");
    } catch (error) {
      console.error("Error posting ad:", error);
    }
  };

  return (
    <LinearGradient
      colors={[COLORS.primary, COLORS.secondary]}
      style={styles.container}
    >
      <ScrollView contentContainerStyle={styles.content}>
        <Text style={styles.title}>Post a Vehicle Ad</Text>
        <TextInput
          style={styles.input}
          placeholder="Title"
          value={form.title}
          onChangeText={(text) => setForm({ ...form, title: text })}
        />
        <TextInput
          style={styles.input}
          placeholder="Price"
          value={form.price}
          onChangeText={(text) => setForm({ ...form, price: text })}
          keyboardType="numeric"
        />
        <TextInput
          style={styles.input}
          placeholder="Category (e.g., Car, Bike)"
          value={form.category}
          onChangeText={(text) => setForm({ ...form, category: text })}
        />
        <TextInput
          style={styles.input}
          placeholder="Location"
          value={form.location}
          onChangeText={(text) => setForm({ ...form, location: text })}
        />
        <TextInput
          style={styles.input}
          placeholder="Year"
          value={form.year}
          onChangeText={(text) => setForm({ ...form, year: text })}
          keyboardType="numeric"
        />
        <TextInput
          style={styles.input}
          placeholder="Mileage (km)"
          value={form.mileage}
          onChangeText={(text) => setForm({ ...form, mileage: text })}
          keyboardType="numeric"
        />
        <TextInput
          style={styles.input}
          placeholder="Description"
          value={form.description}
          onChangeText={(text) => setForm({ ...form, description: text })}
          multiline
        />
        <TouchableOpacity style={styles.imageButton} onPress={handleImagePick}>
          <Text style={styles.imageButtonText}>
            {form.image ? "Image Selected" : "Upload Image"}
          </Text>
        </TouchableOpacity>
        {form.image && (
          <Image source={{ uri: form.image }} style={styles.previewImage} />
        )}
        <TouchableOpacity style={styles.submitButton} onPress={handleSubmit}>
          <Text style={styles.submitButtonText}>Post Ad</Text>
        </TouchableOpacity>
      </ScrollView>
    </LinearGradient>
  );
};

const styles = StyleSheet.create({
  container: { flex: 1 },
  content: { padding: 16 },
  title: {
    fontSize: 24,
    color: "#fff",
    fontWeight: "bold",
    marginBottom: 20,
    textAlign: "center",
  },
  input: {
    backgroundColor: "#fff",
    borderRadius: 8,
    padding: 12,
    fontSize: 16,
    marginBottom: 16,
  },
  imageButton: {
    backgroundColor: COLORS.accent,
    padding: 12,
    borderRadius: 8,
    alignItems: "center",
    marginBottom: 16,
  },
  imageButtonText: { color: "#fff", fontSize: 16 },
  previewImage: {
    width: 200,
    height: 200,
    borderRadius: 8,
    marginBottom: 16,
    alignSelf: "center",
  },
  submitButton: {
    backgroundColor: COLORS.accent,
    padding: 12,
    borderRadius: 8,
    alignItems: "center",
  },
  submitButtonText: { color: "#fff", fontSize: 18, fontWeight: "bold" },
});

export default PostAdScreen;
